function App() {
  return (
    <Switch>
    <div className="App">
    <Navbar />
      <header className="App-header">
        {/* <Link to='/Page1'>HELLO WORLD</Link> */}
        <Route path="/page1" component={Page1} />
        {/* <p className="practice">YO YO YO</p> */}
      </header>
    </div>
    </Switch>
  );
}

export default App;
